import * as React from 'react';
import Box from '@mui/material/Box';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import ImageListItemBar from '@mui/material/ImageListItemBar';
import { useTheme, useMediaQuery } from '@mui/material';

export default function ImageLists() {
  const theme = useTheme();
  const isSmallScreen = useMediaQuery(theme.breakpoints.down('sm'));
  const isMediumScreen = useMediaQuery(theme.breakpoints.between('sm', 'md'));

  // Determine the number of columns based on screen size
  const getColumns = () => {
    if (isSmallScreen) return 1;
    if (isMediumScreen) return 2;
    return 3;
  };

  // Handle click on an image to view it in a new tab
  const handleImageClick = (imageData, mimeType) => {
    const newTab = window.open();
    if (newTab) {
      const htmlContent = `
        <html>
          <body style="margin:0;display:flex;justify-content:center;align-items:center;height:100vh;background-color:#000;">
            <img src="data:${mimeType};base64,${imageData}" style="max-width:100%;max-height:100%;" />
          </body>
        </html>`;
      newTab.document.write(htmlContent);
      newTab.document.close();
    }
  };

  return (
    <Box
      sx={{
        width: '100%',
        maxWidth: 800,
        height: 1200,
        overflowY: 'scroll',
        margin: 'auto',
        border: '1px solid #ddd',
        borderRadius: 2,
        padding: 1,
      }}
    >
      <ImageList variant="masonry" cols={getColumns()} gap={8}>
        {itemData.map((item) => (
          <ImageListItem
            key={item.id}
            onClick={() => handleImageClick(item.img, item.mimeType)}
            style={{ cursor: 'pointer' }} // Makes the images clickable
          >
            <img
              src={`data:${item.mimeType};base64,${item.img}`}
              alt={item.title}
              loading="lazy"
            />
            <ImageListItemBar position="below" title={item.author} />
          </ImageListItem>
        ))}
      </ImageList>
    </Box>
  );
}

// Sample data for the images
